void MOD_mkFBox_Core::vcd_prims(tVCDDumpType dt, MOD_mkFBox_Core &backing)
{
  INST_dw_result.dump_VCD(dt, backing.INST_dw_result);
  INST_dw_valid.dump_VCD(dt, backing.INST_dw_valid);
  INST_frmFpuF.dump_VCD(dt, backing.INST_frmFpuF);
  INST_requestR.dump_VCD(dt, backing.INST_requestR);
  INST_requestR_valid.dump_VCD(dt, backing.INST_requestR_valid);
  INST_resetReqsF.dump_VCD(dt, backing.INST_resetReqsF);
  INST_resetRspsF.dump_VCD(dt, backing.INST_resetRspsF);
  INST_resultR.dump_VCD(dt, backing.INST_resultR);
  INST_stateR.dump_VCD(dt, backing.INST_stateR);
}

void MOD_mkFBox_Core::vcd_submodules(tVCDDumpType dt, unsigned int levels, MOD_mkFBox_Core &backing)
{
  INST_fpu.dump_VCD(dt, levels, backing.INST_fpu);
}
